package Labs.LabExercise_15;public class Employe implements Printable {    String name;    int empID;    double salary;    public Employe(String nm,int id,double sal){        this.name=nm;        this.empID=id;        this.salary=sal;    }    @Override    public void print() {        System.out.println("This is employee class...");        System.out.println("Employee name- "+name);        System.out.println("Employee ID- "+empID);        System.out.println("Employee Salary- "+salary);    }}